class Solution(object):
    def threeSum(self, nums):
        """
        :type nums: List[int]
        :rtype: List[List[int]]
        O(N^2) 复杂度
        """
        nums.sort()
        if len(nums) >= 3 and nums[0] == nums[-1] and nums[-1] == 0:
            return [[0, 0, 0]]

        res = []
        for i in range(len(nums) - 2):
            if i > 0 and nums[i] == nums[i - 1]:
                continue
            l, r = i + 1, len(nums) - 1
            while l < r:
                m = nums[i] + nums[l] + nums[r]
                if m < 0:
                    l += 1
                elif m > 0:
                    r -= 1
                else:
                    res.append([nums[i], nums[l], nums[r]])
                    while l < r and nums[l] == nums[l + 1]:
                        l += 1
                    while l < r and nums[r] == nums[r - 1]:
                        r -= 1
                    l += 1
                    r -= 1
        return res

#Counter是一个简单的计数器
class SolutionBest:
    def threeSum(self, nums):
        """
        :type nums: List[int]
        :rtype: List[List[int]]
        """

        import collections

        d = collections.Counter(nums)
        nums_keys = d.keys()

        # return list(nums_keys)

        pos, neg = [],[]

        for p in nums_keys:
            if p >= 0:
                pos.append(p)
            else:
                neg.append(p)

        r = []

        if d.get(0,0) > 2:
            r.append([0,0,0])

        for i in neg:
            for j in pos:
                tar = - i - j
                if tar in nums_keys:
                    if i< tar < j:
                        r.append([i,tar,j])
                    elif (j==tar or i == tar) and d[tar]>1:
                        r.append([i,tar,j])
        return r

